interface Action {
  type: string;
  payload?: any;
}

export const fetchPolicies = (policies: any) => {
  return {
    type: 'FETCH_POLICIES',
    payload: policies
  }
}

export const fetchErrors = (error: any) => {
  return {
    type: 'FETCH_ERRORS',
    payload: error
  }
}
